Эти врачи приходят на помощь, в буквальном смысле спускаясь с небес на землю. Ведь под белыми халатами у них десантные тельняшки. Мобильный медицинский отряд ВДВ способен за считаные часы не просто оказаться рядом с передовой, но и развернуть там полноценный полевой госпиталь с новейшим медицинским оборудованием. Ведущий "Часового" своими глазами увидит, как работают врачи в полевых условиях, а также сыграет роль "условно раненого", чтобы понять, как хрупкая девушка-медсестра может вытащить с поля боя взрослого мужчину.
А Юлия Розенберг завершает свой ускоренный курс в "Школе выживания". Ведущую и ее боевых подруг ждет финальное испытание - так называемая психополоса. Это целый набор из сложных препятствий, преодолеть которые нужно под канонаду из выстрелов, взрывов и дымовую завесу.
В выпуске принимают участие:
- Сергей Корюкин, начальник хирургического отделения 36 ОМЕДО ВДВ;
- Анна Голубева, старшая медицинская сестра хирургического отделения 36 ОМЕДО ВДВ;
- Олег Харченко, начальник 36 ОМЕДО ВДВ;
- Марат Мянзелин, хирург 36 ОМЕДО ВДВ;
- Иван Редер, командир роты;
- Юлия Сухачева, механик роты.
